        dualx=dual_load_med_bps_avg[cutdual+3:]
        dualy=dual_delay_med_avg[cutdual+3:]
        dualx.insert(0,0)
        dualy.insert(0,0)
        plt.plot(dualx, dualy, 'b--', label="LSDM MAC med")

        plt.plot(waa_load_low_bps_avg[cutwaa:], waa_delay_low_avg[cutwaa:], 'r-.', label="Intra-MAC low")
